`,paraId:5,tocIndex:1},{value:"\u51FD\u6570\u7EC4\u5408 (compose)\uFF1A\u5982\u679C\u4E00\u4E2A\u51FD\u6570\u8981\u7ECF\u8FC7\u591A\u4E2A\u51FD\u6570\u5904\u7406\u624D\u80FD\u5F97\u5230\u6700\u7EC8\u503C\uFF0C\u8FD9\u4E2A\u65F6\u5019\u53EF\u4EE5\u628A\u4E2D\u95F4\u8FC7\u7A0B\u7684\u51FD\u6570\u5408\u5E76\u6210\u4E00\u4E2A\u51FD\u6570\u3002",paraId:6,tocIndex:2},{value:"\u51FD\u6570\u5C31\u50CF\u662F\u6570\u636E\u7684\u7BA1\u9053\uFF0C\u51FD\u6570\u7EC4\u5408\u5C31\u662F\u628A\u8FD9\u4E9B\u7BA1\u9053\u8FDE\u63A5\u8D77\u6765\uFF0C\u8BA9\u6570\u636E\u7A7F\u8FC7\u591A\u4E2A\u7BA1\u9053\u5F62\u6210\u6700\u7EC8\u7ED3\u679C",paraId:7,tocIndex:2},{value:"\u51FD\u6570\u7EC4\u5408\u9ED8\u8BA4\u662F\u4ECE\u53F3\u5230\u5DE6\u6267\u884C",paraId:7,tocIndex:2},{value:`// \u7EC4\u5408\u51FD\u6570
function compose(f, g) {
  return function (x) {
    return f(g(x));
  };
}
function first(arr) {
  return arr[0];
}
function reverse(arr) {
  return arr.reverse();
}
// \u4ECE\u53F3\u5230\u5DE6\u8FD0\u884C
let last = compose(first, reverse);
console.log(last([1, 2, 3, 4]));
`,paraId:8,tocIndex:2},{value:"lodash \u4E2D\u7EC4\u5408\u51FD\u6570 flow() \u6216\u8005 flowRight()\uFF0C\u4ED6\u4EEC\u90FD\u53EF\u4EE5\u7EC4\u5408\u591A\u4E2A\u51FD\u6570",paraId:9,tocIndex:3},{value:`
