\u7A7A\u95F4\u590D\u6742\u5EA6\uFF1AO(k)`,paraId:123,tocIndex:79},{value:`/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var findKthLargest = function (nums, k) {
  const minHeap = new MinHeap();
  for (let i = 0; i < nums.length; i++) {
    h.insert(nums[i]);
    if (h.size() > k) {
      h.shift();
    }
  }
};

class MinHeap {
  constructor() {
    this.heap = [];
  }
  getParentIndex(i) {
    return (i - 1) >> 1;
  }
  getLeftChildIdx(i) {
    return i * 2 + 1;
  }
  getRightChildIdx(i) {
    return i * 2 + 2;
  }
  swap(i, j) {
    const temp = this.heap[i];
    this.heap[i] = this.heap[j];
    this.heap[j] = temp;
  }
  shiftUp(i) {
    if (i === 0) return;
    const parentIdx = this.getParentIndex(i);
    if (this.heap[parentIdx] > this.heap[i]) {
      this.swap(parentIdx, i);
      this.shiftUp(parentIdx);
    }
  }
  shiftDown(i) {
    const left = this.getLeftChildIdx(i);
    const right = this.getRightChildIdx(i);
    if (this.heap[left] < this.heap[i]) {
      this.swap(left, i);
      this.shiftDown(left);
    }
    if (this.heap[right] < this.heap[i]) {
      this.swap(right, i);
      this.shiftDown(right);
    }
  }
  insert(value) {
    this.heap.push(value);
    this.shiftUp(this.heap.length - 1);
  }
  size() {
    return this.heap.length;
  }
  deletePeek() {
    this.heap[0] = this.heap.pop();
    this.shiftDown(0);
  }
  peek() {
    return this.heap[0];
  }
}
