    // \u83B7\u53D6\u6700\u65B0\u7684\u8981\u6E32\u67D3\u7684 virtualDOM \u5BF9\u8C61
    let virtualDOM = this.render();
    // \u83B7\u53D6\u65E7\u7684virtualDOM\u5BF9\u8C61\u8FDB\u884C\u6BD4\u5BF9
    let oldDOM = this.getDOM();
    let container = oldDOM.parentNode;
