`,paraId:11,tocIndex:7},{value:"\u4E4B\u524D\u5DF2\u7ECF\u77E5\u9053 promise \u5BF9\u8C61\u7684 then \u65B9\u6CD5\u4F1A\u8FD4\u56DE\u4E00\u4E2A\u5168\u65B0\u7684 promise \u5BF9\u8C61\uFF0C\u4E5F\u5C31\u662F\u8BF4\uFF0C.catch \u65B9\u6CD5\u91CC\u5B9E\u9645\u4E0A\u4E5F\u6355\u83B7\u4E86\u7B2C\u4E8C\u4E2A promise \u5BF9\u8C61\u7684\u5F02\u5E38\u3002\u800C\u901A\u8FC7 reject \u65B9\u6CD5\uFF0C\u4E0D\u4F1A\u6355\u83B7\u5230\u8FD9\u4E2A\u65B0 promise \u5BF9\u8C61\u7684\u5F02\u5E38",paraId:12,tocIndex:7},{value:`// 1\u3001reject
