`,paraId:13,tocIndex:7},{value:"\u53E6\u5916\uFF0C\u8FD8\u53EF\u4EE5\u4F7F\u7528 unhandledrejection \u65B9\u6CD5\u53BB\u5904\u7406\u4EE3\u7801\u4E2D\u6CA1\u6709\u88AB\u624B\u52A8\u6355\u83B7\u7684 promise \u5F02\u5E38\u3002\u4F46\u662F\u8FD9\u79CD\u65B9\u6CD5\u4E0D\u5EFA\u8BAE\u4F7F\u7528\uFF0C\u5E94\u8BE5\u5728\u4EE3\u7801\u4E2D\u660E\u786E\u6355\u83B7\u6BCF\u4E00\u4E2A\u53EF\u80FD\u7684\u5F02\u5E38\u3002\u5728\u6D4F\u89C8\u5668\u4E2D\u4E00\u822C\u662F\u5C06\u8FD9\u4E2A\u4E8B\u4EF6\u7ED1\u5B9A\u5728 windows \u5BF9\u8C61\u4E0A\u3002\u800C\u5728 node \u4E2D\u4E00\u822C\u662F\u7ED1\u5B9A\u5728 process \u4E0A\u3002",paraId:14,tocIndex:7},{value:`// 1\u3001\u6D4F\u89C8\u5668
window.addEventListener(
  'unhandledRejection',
  (event) => {
    const { reason, promise } = event;

    console.log(reason, promise);
    // reason => promise\u5931\u8D25\u539F\u56E0\uFF0C\u4E00\u822C\u662F\u4E00\u4E2A\u9519\u8BEF\u5BF9\u8C61
    // promise => \u51FA\u73B0\u5F02\u5E38\u7684promise\u5BF9\u8C61
    event.preventDefault();
  },
  false,
);

// 2\u3001node
process.on('unhandledRejection', (reason, promise) => {
  console.log(reason, promise);
  // reason => promise\u5931\u8D25\u539F\u56E0\uFF0C\u4E00\u822C\u662F\u4E00\u4E2A\u9519\u8BEF\u5BF9\u8C61
  // promise => \u51FA\u73B0\u5F02\u5E38\u7684promise\u5BF9\u8C61
});
