 // \u5C06 Virtual DOM \u6302\u8F7D\u5230\u771F\u5B9E DOM \u5BF9\u8C61\u7684\u5C5E\u6027\u4E2D \u65B9\u4FBF\u5728\u5BF9\u6BD4\u65F6\u83B7\u53D6\u5176 Virtual DOM
 newElement._virtualDOM = virtualDOM
