var climbStairs = function (n) {
  // f(n)=f(n-1)+f(n-2)
  // 1 2 3 4
  // 1 2 3 5
  if (n < 2) return 1;
  let p = 1;
  let q = 1;

  for (let i = 2; i <= n; i++) {
    const temp = p;
    p = q;
    q = p + temp;
  }
  return q;
};
